export const logo = {
  app: {
    src: '/abc_logo.png',
  },
};

export const locale = {
  EN: 'en',
  AS: 'as',
  GU: 'gu',
  HI: 'hi',
  KN: 'kn',
  ML: 'ml',
  OR: 'or',
  TA: 'ta',
  TE: 'te',
};

export default {
  locale,
  logo,
};
